INSERT INTO `menu` VALUES ('1', '蒲汁烧鳗鱼', '/upload/menu/412BE8FCA9C40F6F66AC2EAFAE66BA57.jpg', '<p>\r\n	<br />\r\n</p>', '38.00', '0', '1457058675', '2', '星鳗蒲烧汁', '软糯鲜香', '新鲜星鳗 先用七味粉腌制 然后上笼蒸软，浸入特制蒲汁中，再以炭火烤制。口味鲜甜适中，入口即化。同时也是恢复疲劳、防止老化、提高活力的佳品。', '300');
INSERT INTO `menu` VALUES ('2', '罗勒三杯鸡', '/upload/menu/D95FF0676CCB51F174EE6FAD68129D64.jpg', '', '28.00', '0', '1457058699', '2', '鸡腿肉 罗勒叶', '原汁原味 醇香诱人', '一杯米酒 一杯糖 一杯酱油 全程不加一滴水烹制 出锅的时候再放入起香的罗勒叶。三杯鸡这道菜色泽酱红、原汁原味，色香味俱全。', '300');
INSERT INTO `menu` VALUES ('3', '春之圆舞', '/upload/menu/81D055CB6897CEF0222985F91556FA8F.jpg', '', '29.00', '0', '1458469845', '4', '什锦生菜 小胡萝卜 核桃仁 芝麻菜，风干番茄 水煮藜麦  橄榄油面包丁 6分钟水煮蛋 风味烤蔬菜 低温鸡胸肉', '脆爽 鲜嫩', '藜麦是唯一一种单体植物即可基本满足人体基本营养需求的食物。混合各种春季有机蔬菜，低温烤出来的鸡胸肉柔软多汁，蔬菜爽脆的口感，鸡肉的鲜嫩再加上鸡蛋幼滑。整道色拉虽然用了十多种不同的食材，口味确平衡的很好，营养丰富，更能品尝出春天的滋味\r\n700卡路里   65g蛋白质\r\n', '300');
INSERT INTO `menu` VALUES ('4', '马甲男神', '/upload/menu/FA6CF455B10BE5A9EA76F61DBE35ECC2.jpg', '', '42.00', '0', '1458266725', '4', '什锦生菜  玉米笋 小胡萝卜 水煮土豆  核桃仁 清蒸小麦仁 罗勒酱意面 6分钟白煮蛋 风味烤蔬菜   西冷牛肉', '浓香 可口', '想要长肌肉吗，这款绝对是你能量的补充站。怕色拉吃不饱吗，这款绝对是你午餐的加油包。碳烤牛排120G这份量都快赶上正餐牛排的份量了。再加上美味的意大利面，清蒸小麦等。无论你是在锻炼后，还是工作后来上这么一份。绝对能使你能量倍增而且没有负担\r\n700卡路里 65g蛋白质', '300');
INSERT INTO `menu` VALUES ('5', '人鱼女神', '/upload/menu/C011A54202309FD6FFC7F5E66B7EFE34.jpg', '', '36.00', '0', '1458266716', '4', '什锦生菜 小胡萝卜 风干番茄片 水煮藜麦 黄瓜  肉桂南瓜 芝香面包 6分钟水煮蛋 风味烤蔬菜 水煮三文鱼', '清单 香甜', '清爽无油腻的水煮三文鱼，口味清谈，含大量的不饱和脂肪酸和Ω-3脂肪酸。肉桂味道香甜用来烤南瓜，不仅能排毒清肠还是很好的膳食纤维来源。再加上各种有机蔬菜，以及健康的藜麦，吃了绝对美丽的不要不要\r\n550卡路里 55g蛋白质', '300');
INSERT INTO `menu` VALUES ('6', '我型我素', '/upload/menu/C67637BA832F5662EE77D0F8BC758C72.jpg', '', '29.00', '0', '1458266702', '4', '什锦生菜 黄瓜 小胡萝卜 核桃 玉米笋 香料蘑菇 辣味甜薯  6分钟水煮蛋  风味烤蔬菜   盐味素鲍鱼', '甜辣 鲜香', '吃素又要美味健康   这款绝对可以满足你的需求，素鲍鱼富含海藻胶蛋白，无胆固醇，低卡路里。使用高汤煮制，口感绝佳。还有最特别的辣味甜薯，而且是营养齐全而丰富的天然滋补食品，让平淡的口味多出一份刺激与特别\r\n500卡路里  55g蛋白质', '300');
INSERT INTO `menu` VALUES ('7', '滋补水鸭煲', '/upload/menu/CE6F11E8A778B1F9A796733B41304154.jpg', '', '23.00', '0', '1457058715', '2', '鸭肉 白萝卜', '鲜香适口 滋补养身', '采用湛江水鸭 搭配水萝卜以及枸杞 芡实等慢炖而成，鸭肉本身美味都凸显出来。气血双补，是节后滋养身体的一道佳肴。', '300');
INSERT INTO `menu` VALUES ('8', '葱爆黄牛肉', '/upload/menu/27A36DCF46746E54D25E5668A3F5E72E.jpg', '', '23.00', '0', '1457058721', '2', '京葱 黄牛肉 香菜', '原汁原味 奇香四溢', '大葱是温通阳气的养生佐料，适合与肉类同烹，爆炒成菜后，牛肉不仅香辣嫩滑，还有一股淡淡的葱香味，而且常食此菜还有补虚养身、健脾开胃和减肥瘦身之效。', '300');
INSERT INTO `menu` VALUES ('9', '南乳酱烧肉', '/upload/menu/3C6B867C1CD7226535F198638700B54F.jpg', '', '28.00', '0', '1457058728', '2', '猪五花肉 南乳酱', '乳香酥糯 色泽鲜艳', '腐乳肉是一道很家常的菜肴，全国各地都很多不同种类和风格的做法。以腐乳为调味材料，通过一煮二蒸，做出来的腐乳肉肥而不腻、软糯可口、色泽红亮', '300');
INSERT INTO `menu` VALUES ('10', '蘑菇烤春鸡', '/upload/menu/A8E116764021A8CF6B9DA0704FE46112.jpg', '', '28.00', '0', '1457662060', '2', '春鸡腿肉 口蘑', '皮脆肉嫩 鲜美可口', '三个月的童子鸡，去除皮下多余脂肪，用洋葱，大蒜，各种香料混合在黄油中涂抹在鸡上，撒上盐和黑胡椒调味。烤至皮脆肉嫩，汁水饱满的鸡肉搭配蘑菇鸡肉汁，每一口都是法兰西的风情', '300');
INSERT INTO `menu` VALUES ('11', '水果咖喱鸭', '/upload/menu/A3A3DF5635131B99834D8AA66D5FA31E.jpg', '', '23.00', '0', '1457662052', '2', '新鲜鸭肉 黄咖喱酱', '鸭肉软嫩 鲜辣可口', '鸭肉经过腌制，吊烧至皮脆，切成小块，与东南亚风味的咖喱酱一起煮制。皮脆肉嫩，咖喱酱不仅能去除鸭子的腥味，微辣的口感更是令人胃口大开', '300');
INSERT INTO `menu` VALUES ('12', '酱烧鮰鱼翅', '/upload/menu/86ACFAD65ED2FA3F367B59E810164C43.jpg', '', '23.00', '0', '1457662045', '2', '鮰鱼翅 大蒜子', '鲜香滑嫩 酱香浓郁', '鮰鱼乃长江三鲜之一，我们取鮰鱼最肥美的下肚部分，用葱姜去腥，用大酱调味，鱼肉肥腴软糯，咸中带甜。入口时鱼肉鲜嫩、鱼皮黏糯。', '300');
INSERT INTO `menu` VALUES ('13', '凤梨咕佬肉', '/upload/menu/6C85A262A8450B3DED4E7B05888F39F9.jpg', '', '23.00', '0', '1457662039', '2', '新鲜猪肉 凤梨', '酸甜可口 肉香迷人', '咕佬肉又称咕噜肉，菠萝咕佬肉是一道广东的汉族传统名菜，属于粤菜系。此菜口感清新解腻，酸甜的味道又能增进食欲。', '300');
INSERT INTO `menu` VALUES ('14', '菌菇炖肉酱', '/upload/menu/7CDAF40845CD3D4F7BB05D2EA16AC979.jpg', '', '28.00', '0', '1457662027', '2', '牛肉肉糜 意大利香料', '汁浓肉香 原汁原味', '上等牛腿肉绞成肉末，用各式香料与新鲜番茄，红酒还有牛肉高汤一起炖煮五个小时，再加入美味的炒蘑菇增添鲜美的滋味。番茄的酸味，蔬菜的甜味一起承托出牛肉的鲜美。', '300');
INSERT INTO `menu` VALUES ('15', '红酒炖牛腩', '/upload/menu/FE87D72FDAD0228D1583372BA049C43E.jpg', '', '38.00', '0', '1458266552', '2', '牛腩肉 法国红酒', '酒香浓郁 肉质酥烂', '牛腩肉切成麻将大小的块，用勃艮第地区的优质红酒腌制一晚，去除牛肉的腥味。再用各式蔬菜加大量红酒与牛肉一起焖煮九个小时，使其肉烂味浓。汁水色泽红润，口味厚实。', '300');
INSERT INTO `menu` VALUES ('16', '梅干菜烧肉', '/upload/menu/2E409031DA7893F3246AC99BC5D57B17.jpg', '', '28.00', '0', '1458266489', '2', '猪五花肉', '肥而不腻，鲜香', '梅干菜吸收肉脂而去除苦涩，猪肉经梅干菜吸脂肥而不腻。梅干菜肉香交相辉映，是梅干菜与猪肉的绝配', '300');
INSERT INTO `menu` VALUES ('17', '椰香咖喱鸡', '/upload/menu/4AEFBE0EAE8C908FF551166F75338B18.jpg', '', '28.00', '0', '1458266499', '2', '去骨鸡腿', '鲜香肉嫩 香味浓郁', '特制的咖喱酱混合大量新鲜椰汁与香茅草，软嫩的鸡腿肉煎到表皮微微发脆。鲜辣微甜的口感绝对能让你胃口大开', '300');
INSERT INTO `menu` VALUES ('18', '味增三文鱼', '/upload/menu/ECDDB6CDBF3DBFDC1A77C74BC3C7DE57.jpg', '', '38.00', '0', '1458266557', '2', '三文鱼 味增酱', '肉质软糯 口味鲜甜', '一道经典的法式菜肴奶油三文鱼，应加入了东方元素而与众不同。味增酱不但味道鲜美而且营养丰富，搭配三文鱼一起食用能让你整个下午活力满满。 ', '300');
INSERT INTO `menu` VALUES ('19', '鱼香猪肉丝', '/upload/menu/D01FF024B25D3CCC5F7C157B10DE10D2.jpg', '', '23.00', '0', '1458266564', '2', '猪里脊 四川鱼香汁', '微甜 微辣 微咸', '一道国民美食料理，我们坚持使用最正统的做法，每份猪肉丝都手工切成。小甜小酸小辣的口感是评价它的最高标准。', '300');
INSERT INTO `menu` VALUES ('20', '蚝油牛肉片', '/upload/menu/B48EF6E480EC1C3D6FB33DBE4D01B220.jpg', '', '25.00', '0', '1458872013', '2', '澳洲牛肩肉', '肉质滑嫩', '牛肩肉切成厚片，用盐，糖，酱油。太白粉腌制。与新鲜蔬菜，蚝油汁一同翻炒。菜肴简单却不简约。忠于自然原味。口味新鲜。', '300');
INSERT INTO `menu` VALUES ('21', '澳式烧肉排', '/upload/menu/8B3887F247A0F779D8B8F6A22EED2B4F.jpg', '', '28.00', '0', '1458872044', '2', '猪肉', '肥而不腻，鲜香', '猪梅花肉肥瘦相间，长时间用心敲打，敲断肉中的筋膜，用白兰地腌制，使其充分吸收酒香，入锅炸至酥脆，配上特制排骨酱翻炒。肉质丰富，齿颊留香。', '300');
INSERT INTO `menu` VALUES ('22', '日式照烧鸡', '/upload/menu/E8D6176ACD3A3CF079711A708BAB1B24.jpg', '', '23.00', '0', '1458872021', '2', '去骨鸡腿', '咸甜适中', '用日本赤糖加入鸡骨高汤做底，秘制而成的照烧汁均匀的涂抹在鸡肉上面，用炭火烘烤，保持鸡肉的软嫩，香气十足。搭配酱汁一起与米饭食用绝对一流。', '300');
INSERT INTO `menu` VALUES ('23', '剁椒龙利鱼', '/upload/menu/B697B68AA1F11D161A2DC69788FF673A.jpg', '', '25.00', '0', '1458872038', '2', '龙利鱼', '肉质软糯 鲜辣爽口', '喜欢吃剁椒鱼头，又怕吐骨头，这道没有鱼骨头的剁椒龙利鱼一定能满足你。龙利鱼本身肉质鲜甜，配上四川湛江独特的剁椒一起蒸制，美味又营养。', '300');
INSERT INTO `menu` VALUES ('24', '本帮酱鸭腿', '/upload/menu/99EF01597770D518AEC47B3B2ED5E254.jpg', '', '23.00', '0', '1458872031', '2', '鸭腿', '微甜微咸', '老上海喜欢的味道，鸭肉小火慢煮，配以为数不多几位香料。等到汤汁里面的橙皮全部融化，再大火收汁。传统的工艺，为的就是这一口记忆里的味道。', '300');
INSERT INTO `menu` VALUES ('25', '温热加州色拉', '/upload/menu/8E4725D489EB258F39289C8F7E43D450.jpg', '', '26.00', '1', '1458470473', '4', '甜薯 烟熏咸肉 蓝波芝士 蔓越莓干 山核桃 蒜味面包薄片', '加州味道', '加利福尼亚州（California）是美国西部太平洋沿岸的一个州，土地肥沃，物产丰富，我们精选大地的特产，用最合适的方式把它们组合在一起，甜，咸，辣，酸，味道的平衡，感受大地的馈赠。', '300');
INSERT INTO `menu` VALUES ('26', '阳光农场色拉', '/upload/menu/91C9D14EBF0A404D8651C41E17270DD5.jpg', '', '26.00', '1', '1458470445', '4', '甜南瓜  甘蓝菜  藜麦  果木鸭肉  红洋葱  西兰花', '爽脆入口', '自产自销的农场，天然有机的蔬菜，长时间沐浴在阳光下，营养健康。用苹果木碳烤的鸭胸肉，香气四溢，肉质细嫩，混合着蜂蜜油醋汁，满口都是自然的味道。', '300');
INSERT INTO `menu` VALUES ('27', '马德里温色拉', '/upload/menu/E446CF286A075287557DB4863B15806D.jpg', '', '29.00', '1', '1458470410', '4', '花菜  猪肚菌  亚麻籽  菲达芝士  红酒炖章鱼', '热情如火', '西班牙“斗牛犬”餐厅的员工色拉，营养丰富，美味可口。我们使用本地食材，配合独特的红酒炖章鱼，让你体验原汁原味的西班牙风情。', '300');
INSERT INTO `menu` VALUES ('28', '小鸡小米色拉', '/upload/menu/BB922C04E77645A778613460A059BAD6.jpg', '', '32.00', '1', '1458470348', '4', '鸡豆 中东小米 有机节瓜 香料三文鱼 红葱 南瓜子', '糯香爽口', '中东小米乃伊斯兰国家的主食之一，其蛋白质含量很高，很适合现代人体食用。拌入中东特色香料与各式蔬菜。清爽的三文鱼涂上美味的酱料蒸至成熟，健康无负担。', '300');
INSERT INTO `menu` VALUES ('29', '黄咖喱牛腩', '/upload/menu/E324B874EA3E3326C0C755AE5933C768.jpg', '', '32.00', '1', '1458872635', '2', '澳洲牛肩肉', '肉质酥软', '泰国咖哩分青咖喱、黄咖喱、红咖喱等多个种类。其中青咖哩最辣，不习惯的人进食时容易流眼泪。泰国咖喱当中加入了椰酱来减低辣味和增强香味，而额外所加入的香茅、鱼露、月桂叶等香料，也令泰国咖喱独具一格。', '300');
INSERT INTO `menu` VALUES ('30', '台式卤肉酱', '/upload/menu/FADCE8FFC79E17121D5DE2B35BFF4C58.jpg', '', '28.00', '1', '1458873341', '2', '猪肉', '肥而不腻', '嗜肉族们看过来，无比过瘾的五花肉吃法——台式卤肉饭，绝对能让你心花怒放。五花肉经过香料的长久焖炖，肥肉已近透明，瘦肉酥且糯，细品，虽然所用调料与红烧肉相差不多，但味道却完全不同于红烧肉。', '300');
INSERT INTO `menu` VALUES ('31', '金蒜葱油鸡', '/upload/menu/C20D93D7F4145A49BDE4227F25EF226A.jpg', '', '28.00', '1', '1458872714', '2', '本地三黄鸡', '肉质细嫩', '上海传统名菜，做法类似白斩鸡，鸡肉细嫩。此菜用材简单，制作方便，滑润细嫩，清鲜醇厚，葱香四溢。很适合春夏季食用。', '300');
INSERT INTO `menu` VALUES ('32', '干烧带鱼块', '/upload/menu/26F219887E9ABF8BE04C46BED38BF122.jpg', '', '25.00', '1', '1458873328', '2', '带鱼中段', '肉质鲜嫩 鲜辣', '干烧乃川菜中著名的烹调方法  使用豆瓣酱 甜酒酿等烧制食材，成品色泽红亮，口味鲜美，鱼肉细嫩。', '300');
INSERT INTO `menu` VALUES ('33', '红翻天麻鸭', '/upload/menu/4665C838259A9E3C972BCA8F2DED5810.jpg', '', '25.00', '1', '1458872809', '2', '鸭腿', '鲜辣可口', '选用绍兴麻鸭 用十三香卤料卤制，再入油锅炸香，混合湘江辣椒翻炒而成，口感鲜香，麻辣爽口。', '300');
